import "./Header.css"
import { MdLogout } from 'react-icons/md'
function Header(isLogin) {

    let logoutBtn = null;
    if(isLogin) (
        logoutBtn = <MdLogout onClick={() => console.log("Test")}/>
    )

    return (
        <div id="header">
            <b id="logo">
                409 Labs
            </b>
            {logoutBtn}
        </div>
    )
}

export default Header;
